description:
Study Peter's Denials As Repetition Of Edict Of Milan To End Killing Of Christians Leads To NSL 
Study Note: http://prophesyagain.org/wp-content/uploads/2015/10/Study-Peters-Denials-As-Repetition-Of-Edict-Of-Milan-To-End-Killing-Of-Christians-Leads-To-NSL-.pdf
It is not enough to have good intentions; it is not enough to do what a man thinks is right or what the minister tells him is right. His soul's salvation is at stake, and he should search the Scriptures for himself. However strong may be his convictions, however confident he may be that the minister knows what is truth, this is not his foundation. He has a chart pointing out every waymark on the heavenward journey, and he ought not to guess at anything.  {GC 598.1}
